import numpy as np
from past.builtins import xrange


class KNearestNeighbor(object):
    def __init__(self):
        pass

    def train(self, X, y):
        self.X_train = X
        self.y_train = y

    def predict(self, X, k=1):
        distance_matrix = self.compute_distances(X)
        num_test = distance_matrix.shape[0]
        y_pred = np.zeros(num_test)

        for i in xrange(num_test):
            closest_y = []
            k_nearest = distance_matrix[i].argsort()[:k]
            closest_y = self.y_train[k_nearest]
            vals,counts = np.unique(closest_y, return_counts=True)
            y_pred[i] = vals[np.argmax(counts)]

        return y_pred

    def compute_distances(self, X):
        num_test = X.shape[0]
        num_train = self.X_train.shape[0]
        distance_matrix = np.zeros((num_test, num_train))
        tst_sum = np.sum(X ** 2, axis = 1, keepdims=True)
        trn_sum = np.sum(self.X_train ** 2, axis = 1)
        distance_matrix = tst_sum + trn_sum - (2 * X.dot(self.X_train.T))
        return distance_matrix




















































