    "num_folds = 5\n",
    "k_choices = [1, 3, 5, 8, 10, 12, 15, 20, 50, 100]\n",
    "\n",
    "X_train_folds = []\n",
    "y_train_folds = []\n",
    "################################################################################\n",
    "# TODO:                                                                        #\n",
    "# Split up the training data into folds. After splitting, X_train_folds and    #\n",
    "# y_train_folds should each be lists of length num_folds, where                #\n",
    "# y_train_folds[i] is the label vector for the points in X_train_folds[i].     #\n",
    "# Hint: Look up the numpy array_split function.                                #\n",
    "################################################################################\n",
    "X_train_folds = np.array_split(X_train,num_folds)\n",
    "y_train_folds = np.array_split(y_train,num_folds)\n",
    "################################################################################\n",
    "#                                 END OF YOUR CODE                             #\n",
    "################################################################################\n",
    "\n",
    "# A dictionary holding the accuracies for different values of k that we find\n",
    "# when running cross-validation. After running cross-validation,\n",
    "# k_to_accuracies[k] should be a list of length num_folds giving the different\n",
    "# accuracy values that we found when using that value of k.\n",
    "k_to_accuracies = {}\n",
    "\n",
    "\n",
    "################################################################################\n",
    "# TODO:                                                                        #\n",
    "# Perform k-fold cross validation to find the best value of k. For each        #\n",
    "# possible value of k, run the k-nearest-neighbor algorithm num_folds times,   #\n",
    "# where in each case you use all but one of the folds as training data and the #\n",
    "# last fold as a validation set. Store the accuracies for all fold and all     #\n",
    "# values of k in the k_to_accuracies dictionary.                               #\n",
    "################################################################################\n",
    "for k in k_choices:\n",
    "    fold_acc = []\n",
    "    for f in range(num_folds):\n",
    "        x_trn = np.vstack(X_train_folds[:f] + X_train_folds[f+1:])\n",
    "        y_trn = np.hstack(y_train_folds[:f] + y_train_folds[f+1:])\n",
    "        x_val = X_train_folds[f]\n",
    "        y_val = y_train_folds[f]\n",
    "        \n",
    "        knn = KNearestNeighbor()\n",
    "        knn.train(x_trn,y_trn)\n",
    "        y_val_preds = knn.predict(x_val, k)\n",
    "        \n",
    "        num_correct = np.sum(y_val_preds == y_val)\n",
    "        accuracy = float(num_correct) / num_test\n",
    "        fold_acc.append(accuracy)\n",
    "        \n",
    "    k_to_accuracies[k] = fold_acc\n",
    "################################################################################\n",
    "#                                 END OF YOUR CODE                             #\n",
    "################################################################################\n",
